
CREATE TABLE users (
    id VARCHAR(50) PRIMARY KEY,
    username VARCHAR(100),
    email VARCHAR(200),
    password VARCHAR(100)
);

CREATE TABLE products (
    id VARCHAR(50) PRIMARY KEY,
    name VARCHAR(255),
    price DECIMAL(10,2),
    stock INT,
    description TEXT,
    image TEXT,
    categoryId VARCHAR(50),
    sellerId VARCHAR(50) NULL,
    featured BOOLEAN
);

